import React, { useState } from 'react';
import { Button, Container } from 'react-bootstrap';
import styles from '../cssPage/potfolio.module.css';
import Projects from './Projects';

function ProjectShowcase() {
  const [section, setSection] = useState('completed');
  return (
    <div>
      <Container>
        <h1 className="text-center ">Projects</h1>
        <div className="d-flex align-items-center gap-3 justify-content-center mt-4">
          <strong className={section === 'completed' ? '' : 'opaci'}>
            Completed{' '}
          </strong>
          <strong className={section === 'incomin' ? '' : 'opaci'}>Incoming</strong>
        </div>
        <div>
          <Projects />
        </div>
      </Container>
    </div>
  );
}

export default ProjectShowcase;
